import React from 'react';
import {
  BackgroundWrapper,
  BoldText,
  MyPostWrapper,
  ProfileImg,
  ProfileInfoWrapper,
  ProfileWrapper,
  Text,
  UserId,
} from './MypageStyle';
import Profile from '../../assets/img/profile.jpg';

const Mypage: React.FC = () => {
  return (
    <BackgroundWrapper>
      <ProfileWrapper>
        <ProfileImg src={Profile} />
        <ProfileInfoWrapper>
          <UserId>char_smine</UserId>
          <Text>게시물</Text>
          <BoldText>41</BoldText>
        </ProfileInfoWrapper>
      </ProfileWrapper>
      <MyPostWrapper />
    </BackgroundWrapper>
  );
};

export default Mypage;
